import './styles.css';
import Header from './components/Header'
import Skills from './components/Skills'
import Education from './components/Education'
import Work from './components/Work'

function App() {
  return (
    <div>
      <Header />
      <hr />
      <Skills />
      <hr />
      <Education />
      <hr />
      <Work />
      <hr />
      <Personal />
    </div>
  );
}

export default App;
